    "Stable and Efficient Gaussian Process Calculations",nt"tracking_summary":
    {ntt"total": 2,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-02-26T22:01:54.770892",nt"name": "stable-and-efficient-gaussian-process-calculations",nt"isopen":
    true,nt"url": null,nt"notes": "The use of Gaussian processes can be an
    effective approach to prediction in a supervised learning environment. For large
    data sets, the standard Gaussian process approach requires solving very large systems
    of linear equations and approximations are required for the calculations to be practical.
    We will focus on the subset of regressors approximation technique. We will demonstrate
    that there can be numerical instabilities in a well known implementation of the
    technique. We discuss alternate implementations that have better numerical stability
    properties and can lead to better predictions. Our results will be illustrated by
    looking at an application involving prediction of galaxy redshift  from broadband
    spectrum data.",nt"license_title": "U.S. Government Work",nt"extras":
